    "2013-03-28T01:14:26.342411",nt"name": "gap-land-cover-vector",nt"isopen":
    false,nt"url": null,nt"notes": "This vector dataset is a detailed (1-acre
    minimum), hierarchically organized vegetation cover map produced by computer classification
    of combined two-season pairs of early-1990s Landsat 4/5 Thematic Mapper (TM) satellite
    imagery, as part of the Upper Midwest Gap Analysis Program (UMGAP)(http://www.umesc.usgs.gov/umgaphome.html)
    of the U.S. Geological Survey. Units of analysis were Minnesota Ecological Classification
    System (ECS)(http://www.dnr.state.mn.us/ecs/index.html) subsections subdivided by
    TM scenes. GAP typology and classification protocols are closely comparable across
    Minnesota, Wisconsin and Michigan. For ease of use in ArcView, the cell based data
    was converted to vector format and tiled by 7 1/2 minute quadrangle.",nt"license_title":
